Ko gero pirmą kartą du garsūs atlikėjai atvėrė įrašų studijos duris ir parodė, kaip vyksta dainos įrašymo procesas. Paviešintame vaizdo įraše girdisi ne tik naujosios dainos fragmentai, tačiau ir abiejų atlikėjų atviras pokalbis apie ką yra naujoji daina. „Iš šalies gali lengvai pasirodyti jog mes nešam skirtingus įvaizdžius“, - šypsosi Donatas. „Tačiau tik įžengus į irašų studiją mes esam du „psichai“, kurie žino ko nori ir kaip tai pasiekti, kad rezultatas būtų geriausias“, - atviravo atlikėjas. Atlikėjo Donato Montvydo įrašų studijoje abu žinomi vyrai diskutuoja, apie ką yra naujoji daina. „Pasakyk kamerai ir žmonėms apie ką ši daina?“, – E. Dragūną kompromituoja linksmai nusiteikęs D. Montvydas. Sel lyderis nedvejodamas atsakė į klausimą: „Apie ką, apie tavo žmoną, apie ką. Aš nesuprantu, kaip tu kuri tokias dainas, turėdamas du vaikus ir žmoną“, - juoko ir ironijos neslepia skandalingasis E. Dragūnas. „Šitą dainą sukūriau apie tavo buvusius santykius“, - Sel lyderiui šmaikštaudamas atsikirto Donatas. „Ačiū. Visi mes darome klaidų“, - juokdamasis naujajam scenos partneriui atsakė E. Dragūnas. Vėliau, suskambus telefonui, Donatas juokaudamas pasakė: „Egi, tau skambina mano žmona“. Šis intriguojantis vaizdo įrašas, ko gero, įstrigs ne vienam abiejų atlikėjų gerbėjui, nes naujosios dainos įrašymo užkulisius kiekvienas galės išvysti iš arti. Donatas Montvydas atskleidė, kad šios dainos premjeros data kol kas dar nėra tiksli, tačiau šią dainą išgirsti turės galimybę į abiejų atlikėjų koncertus susirinkę gerbėjai. Ar tiek Donatas Montvydas, tiek Egidijus Dragūnas pasirodys vienas kito koncertuose kaip svečiai – kol kas neatskleidžiama. Primename, kad didžiausioje šalies arenoje Kaune Sel grupės koncertas įvyks jau gruodžio 2 d., o Donato Montvydo šou „Kalėdos LIVE Cirkas“ – gruodžio 26 d. (function(d, s, i, r) {
